import Header from '../components/header.js';
import Footer from '../components/footer.js';

function Contact()
{
    return(
        <>
        <Header />
        <div className='w-fit h-[600px] relative flex items-center justify-center pl-10 pr-10 '>
            <div className='w-1/3 h-[200px] bg-gray-600 flex flex-col items-center'>
                <div className='text-right'>

                     {/* MESAJUL */}    <h1 className='text-white text-[32px]'>Bine ai venit,</h1>
                   {/* EMAILUL*/}     <small className='text-white'>email@email.com</small>

                </div>
            </div>
        </div>
        <Footer />
        </>
    )
}

export default Contact;
